INSERT INTO `tb_projects` VALUES (6, '三国演义项目', '吴承恩', '刘备', '关羽', '三国演义应用', '念刘备、关羽、张飞，虽然异姓，既结为兄弟，则同心协力，救困扶危；上报国家，下安黎庶。不求同年同月同日生，只愿同年同月同日死。皇天后土，实鉴此心，背义忘恩，天人共戮！', '2019-12-13 09:34:02.500893', '2019-12-13 09:34:02.500893');
INSERT INTO `tb_projects` VALUES (7, '庆余年项目', '猫腻', '范闲', '林婉儿', '庆余年研究应用', '人生在世，总得努力地去做些什么，就算被人耻笑天真，也总得默默试一下。当然，天真的事情，总是容易失败。不过，任何伟大的事情，在最开始的时候，难道不都是显得格外理想主义，天真到了令人耻笑的地步？', '2019-12-13 09:34:15.966268', '2019-12-13 09:34:15.966268');
INSERT INTO `tb_projects` VALUES (8, '学猫叫项目', '小峰峰', '小潘潘', '喵喵喵', '学猫叫歌曲应用', '我们一起学猫叫，一起喵喵喵喵喵，在你面前撒个娇，哎呦喵喵喵喵喵，我的心脏砰砰跳，迷恋上你的坏笑，你不说爱我我就喵喵喵。', '2019-12-13 09:34:15.967265', '2019-12-13 09:34:15.967265');
